When you start with an awesome product you can create amazing things! Built with the eCommerce functionality in mind, Free Shopkeeper WordPress Theme is a fully responsive Premium WooCommerce Theme with a great design and extensive functionality.


Speed is important, especially when it comes to eCommerce sites. We&#x2019;re making sure Shopkeeper WordPress Theme won&#x2019;t slow you down and we aim to improve whenever we find room for it.

Versatile, fully customable &amp; easy to use. Choose from a great number of design elements, pre-built layouts and advanced Shopkeeper WordPress Theme options or easily create new layouts that fit your needs.


Shopkeeper WordPress Theme Features

[*]Easy Logo Uploading;
[*]Adjustable Logo Size;
[*]Option to have an alternative logo on mobiles;
[*]Centered Logo / Split Navigation;
[*]Transparent Header &amp; Page Specific Color Schemes;
[*]Hamburger / Off-Canvas Navigation;
[*]Adjustable Header Size;
[*]Adjustable Font Sizes;
[*]Adjustable Colors;
[*]Option to Upload Custom Icons;
[*]Option to Enable / Disable the Sticky Header
